import FormElement from "./FormElement";


const AddForm = () => {
    return (
        <div>
            <form>
                <FormElement label="Name" inputElement={<input type="select"></input>} />
                <FormElement label="Product purchased" inputElement={<input type="text"></input>} />
                <FormElement label="Price" inputElement={<input type="text"></input>} />
                <FormElement label="Date" inputElement={<input type="text"></input>} />
            </form>
        </div>
    )
}

export default AddForm;
